B.HN=new A.c3("Preperation",'This project Started out by reading "I used to know that: General Science", where I re-learnt about e=mc\xb2, \nand how that was the formula to figure out how much energy was in an object.\n\nI then came up with idea usng the previous knowledge and the knowledge that fire converts stored energy into other forms of energy,\nI created a science experiment. This science experiment was to figure out ho much energy would be released from a book if you burnt it.\n\n',null)
B.HW=new A.c3("Project","I theorized about how to calculate the answer and eventually came up with the formula Energy Released = (Mass before - Mass after)times the speed of light\xb2 / the time it took to burn. \n\nOnce I had the formula down it was time to test so I burnt a book with mass of 163grams.\n\n\n",null)
