B.HG=new A.c3("4 Sided Pong","With Saphi I was learning Python from a Udemy course, and part of this course I was following, was to code a pong game. I naturally got the idea to make Pong a generational game known by millions harder, I did this by adding Two new sides to worry about, the up and down sides. the upper side of the screen is controlled by the left player, and the bottom part of the screen is controlled by the right hand player.\n\n",null)
B.HH=new A.c3("Reflect","Through out my projects I highlighted a few major key issues both with presenting my work and the work itself; \n\nA major issue was motivation to get started. \n\nPresenting the work in a way that would keep my attention with minimal resources. \n\nIdentifying and troubleshooting mistakes in the tutorials I was following.\n\n\n",null)
B.HL=new A.c3("Preperation","The glove project is a school project conducted by Lucas P.E Newman, to try and create a wear-able glove like device with the potential to recognise hand positions and movement through 5 flex sensors located at each finger and the gyroscopic and accelerometer sensors on the hand, the device is designed to convert the data received form the sensors to a verbal form of communication like English through comparing the data to a sign language database. The final product is to be comfortable to wear, aesthetically pleasing, durable, as well as holding a function in everyday use.\n\n",null)
B.HO=new A.c3("Preperation","In addition to my Learning Plan and Proposal, part of my preperation for this project was to create a research document answering the following questions \n\nWhat is AAC?\nWhat are the main types of AAC devices and programs?\nWhy do people use AAC devices and programs?\nwho are the main demographic thay use AAC devices and programs?\nWhat are the beneficial aspects of AAC devices and programs?\nHow Could AAC Programs and devices be improved?\n\n",null)
B.HQ=new A.c3("Project","As the first part of my project I emailed PiUpMyLife and asked if I could use their tutorials for my project, \n they ended up getting back to me saying yes, I could use their tutorials for my project and thankyou for asking, I ended up using two of the tutorials; \n\nSetting Up RetroPi\n\nRetroPi is an emulation software designed to emulate PC, Console, and other various types of games on the Raspberry Pi. \nI set-up the software following the tutorial PiUpMyLife gave me as the first part of my project. \n\nI completed the final project using my previous knowledge on the Raspberry Pi from completing the two tutorials I completed previously. \nI ended up using my knowledge on the Raspberry Pi to create a room temperature and humidity sensor, that displays the information by a 8x8 grid of RGB LED lights. \n\n\n",null)
B.HS=new A.c3("Reflect","Version one: \n\nThe first version of the glove was designed with a Raspberry Pi zero w and three flex sensors to create a test of the product, it was planned to have an gyroscopic and accelerometer as well as a HAT for the Raspberry Pi zero w, the HAT was to allow for a battery specifically a 3-pin Li-Po battery at 1000mAh to be connected this, but this version only got to testing the microcontroller before a realisation was made, the raspberry Pi zero w doesn\u2019t allow for ADC, which meant that the flex sensors that were going to be used in the test could not be used, due to not being able to measure the output of the flex sensors. \n\n\nVersion two:  \n\nThe second version of the glove project was designed to improve where the previous version failed, by implementing a new microcontroller, the Pimoroni Pico Li-Po. This microcontroller had 3 ADC pinouts and a battery connection inbuilt into the microcontroller, this adjustment allowed testing with the flex sensors as well as no need for a separate HAT for a battery connection but at the cost of changing the battery connection type from 3-pin connecter to a 2-pin JST-PH connector. We ended up testing the three flex sensors and made sure they worked, but soon came into a few problems, how were we going to transfer the data; we couldn\u2019t access the required data for all sign language signs due to only having three ADC pinouts; the battery could be damaged relatively easily and so could the electronics due to them not being covered.\n\nVersion three:\n\nThis version was made to fix the outlining issues with the previous version. how were we going to transfer the data; we couldn\u2019t access the required data for all sign language signs due to only having 3 ADC pinouts; the battery could be damaged relatively easily and so could the electronics due to them not being covered.\nWe did this by first finding a new microcontroller, one that has more then 3 ADC pinouts, a battery connector to allow for a streamlined battery connection, and a Bluetooth connection to transfer the data easily and wirelessly from the sensors. We ended up with a Adafruit feather 32uf Bluefruit LE module. This microcontroller has Bluetooth connection built in and documentation letting it to act has as a HID device. With this I was able to send the data collected from the sensors wirelessly and it can have a custom output, if you make a c shape with your hand it could output the letter \u2018C\u2019. I was also able to 3d print a battery protection plate that encases the battery, to make sure the battery can be protected from any unforeseen damage coursed by hitting the battery against tougher things.\n\nVersion four:\n\nVersion four finally added the 3d accelerometer and gyroscopic sensors to let the glove sense hand positioning and movement, not just sensing the movement of the fingers. All tests went well with it and the data was able to be received and read by the glove.\n\nVersion five:\n\nVersion five is in the designing stage at the point of writing this, its purpose it to battle the delicate nature of the glove so far and make sure it doesn\u2019t break itself with vast use and to test the best way to protect the electronics inside the glove. Another change was making the charging port more accessible allowing for an easier time to recharge the device.\n\n\n",null)
B.HU=new A.c3("Preperation",'Leading up to this project I completed some research onto projects with the Raspberry Pi and Arduino to help decide which I wanted to focus on learning and which will benefit me most to learn. \nI settled onto learning about the Raspberry Pi, answering the following question; \n\n "How can learning from structured projects influence my use of the Raspberry Pi?" \n\nUsing this Question I created a Learning Plan and Project Proposal to help outline my learning;\n\n',null)
B.HV=new A.c3("Snake Game","A snake game, what a better way to repersent a learning a code thats named after a snake. Essestially that I made snake the classic game in python.\n\n\n",null)
B.HY=new A.c3("Reflect","While I did complete this project it came with a Few major issues \n\nThese were mostly with saving my work and work life balance, it was already good but I needed to do better because ultimately I had to restart from an old save which sent me back in my project by alot. \n\nAnother Issue with this project was with my work life balance, even if I heavily catered towards my work it is important to keep a good balance.\n\n\n",null)
B.HZ=new A.c3("Reflect","This Project in not finished yet, but I can reflect from what has happened reguarding the glove project so far. \n\nGathering the materials and managing my time in order for me to create the divice a bug test is a major hurtle in this projects lifespan \nSand needed to handled well otherwise I would not be anywhere near finishing this project.\n\n\n",null)
B.I0=new A.c3("Introduction","The original idea for the glove project came from me finding out about a type of sensor called a flex sensor when scrolling an online store, essentially a resistor like electrical component that increases resistance of an electrical circuit when flexed letting you measure how much its flexed. After finding out about the flex sensor I came up with the idea of using it to measure the percentage that fingers are flexed for a sign-language conversion device. This idea came from working on an augmentative and alternative communication (AAC) program designed to help develop or replace verbal communication. The idea of using electronics to be used for assistive communication is not a new idea, neither is using a glove like device to recognise sign language. It has been done many times and I\u2019ve done it one more time.\n\n\n",null)
B.I1=new A.c3("Project","After My preperation for this project and researching into Augmentative and Alternative Communication Devices and programs I set out to make my own program. \nI didnt know where to start or even what to use to create my program but after going to my LTI I learnt about Flutter and Dart, which I used to create my program.\nAfter learning Flutter and Dart, and finishing my work I ran into a problem, I acidentally deleted alot of my work while figuring out Github and how to utilize it. So I had to restart from an old save of my work.\n\n\n",null)
